import React from 'react';
import moment from 'moment';

const DateCell = ({date}) => {

  const toDay = Date().substring(0,15);
  const calendarCell = String(date._d).substring(0,15);

  console.log(toDay, 'today');
  console.log(calendarCell, 'calendars');
  
  

  return (
    <>
      {calendarCell == toDay ?
      <div style={{ backgroundColor:'red', width: '55px', height: '3px', marginTop: '0px'}}></div>
      :
      null
      } 
    </>
  )
}

export default DateCell;
